import {ADD_NEW_MESSAGE} from '../actions/actionsType';
const initialState={
    roomInform: {
        roomName: "My chat",
        numberUsers: 0,
        numberMessages: 0,
        lastMessageDate: "0",
      }
};

export function headerReducer(state=initialState,action){
    switch (action.type) {
        case ADD_NEW_MESSAGE:
            return state;

        default:
            return state;
    }
}
